/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<span class="ui5-popup-frame" @focusin="${context._onfocusin}"><span id="${ifDefined(context._id)}-firstfe" tabindex="0"></span><div style="${ifDefined(context.zindex)}" class="ui5-dialog-root-parent ${classMap(context.classes.dialogParent)}"><section tabindex="-1" aria-labelledby="${ifDefined(context.headerAriaLabelledBy)}" role="dialog" aria-modal="true" class="ui5-popup-root ui5-dialog-root ${classMap(context.classes.dialogParent)}">			${ context.hasHeader ? block1(context) : undefined }<section class="ui5-dialog-section"><div class="ui5-popup-content"><div class="ui5-popup-scroll"><slot></slot></div></div></section>			${ context.hasFooter ? block4(context) : undefined }</section></div><span id="${ifDefined(context._id)}-lastfe" tabindex="0"></span><div tabindex="0" id="${ifDefined(context._id)}-blocklayer" style="${ifDefined(context.blockLayer)}" class="${classMap(context.classes.blockLayer)}"></div></span>`; };
const block1 = (context) => { return html`<header>			${ context.header.length ? block2(context) : block3(context) }</header>	`; };
const block2 = (context) => { return html`<div id="${ifDefined(context._id)}-popup-heading" role="${ifDefined(context.role)}" class="ui5-popup-header"><slot name="header"></slot></div>			`; };
const block3 = (context) => { return html`<h2 id="${ifDefined(context._id)}-popup-heading" class="ui5-popup-header ui5-popup-headerText">${ifDefined(context.headerText)}</h2>			`; };
const block4 = (context) => { return html`<footer><div class="ui5-popup-footer" role="toolbar"><slot name="footer"></slot></div></footer>	`; };

export default block0;
